import { Swiper, SwiperSlide } from "swiper/react";
import 'swiper/swiper-bundle.min.css'
import 'swiper/swiper.min.css'
import './scroll.css'
import Img from "./imges";

function Scroll() {

  return (
    <div className="mainCont">
      <h3>დაატრიალე რჩეული სლოტები:</h3>
      <p>*სპინზე ფსონის მინ. რაოდენობა შეზღუდული არ არის.</p>
      <div className="slider">
        <Swiper
          spaceBetween={50}
          slidesPerView={5}
          onSlideChange={() => console.log("slide change")}
          onSwiper={(swiper) => console.log(swiper)}>
          <SwiperSlide><img src={Img.img1} alt=''/></SwiperSlide>
          <SwiperSlide><img src={Img.img2} alt=''/></SwiperSlide>
          <SwiperSlide><img src={Img.img3} alt=''/></SwiperSlide>
          <SwiperSlide><img src={Img.img4} alt=''/></SwiperSlide>
          <SwiperSlide><img src={Img.img5} alt=''/></SwiperSlide>
          <SwiperSlide><img src={Img.img6} alt=''/></SwiperSlide>
          <SwiperSlide><img src={Img.img7} alt=''/></SwiperSlide>
          <SwiperSlide><img src={Img.img8} alt=''/></SwiperSlide>
          <SwiperSlide><img src={Img.img9} alt=''/></SwiperSlide>
          <SwiperSlide><img src={Img.img10} alt=''/></SwiperSlide>
          <SwiperSlide><img src={Img.img11} alt=''/></SwiperSlide>    
          <SwiperSlide><img src={Img.img12} alt=''/></SwiperSlide>


        </Swiper>
      </div>
    </div>
  );
}
export default Scroll;
